    return(
        <>
            {people.map((person)=>{
                const {id, name, age, image} = person;
                return(
                    <Card key={id} sx={{width: 300, height: 300, backgroundColor: "#fff",}}>
                        <img src={image} alt={name} />
                        {/* <CardHeader title={name} subheader={age + ' years'} /> */}
                    </Card>
                        
